import React, { Component } from 'react';
import Button from '@material-ui/core/Button';
import { createGlobalStyle } from "styled-components";

import Skiarea_list from '../pages/Skiarea_list';


//display,justify-contentで要素を横並びにしている。
const GlobalStyle = createGlobalStyle`
div .button{
text-align:center;
}
`;

class Buttun extends Component {

  render() {
    return (
    <div className='button'>
      <GlobalStyle />
      <Button variant="contained" color="primary" href={Skiarea_list}>
      <Link component={Skiarea_list} to="/skiarea">
          Simple case
        </Link>
          </Button>
    </div>
    )}
}

export default Buttun;
